import ExpenseItem from "./components/ExpenseItem.js";
import DateTime from "./components/greetings.js";

const App = () => {
    return(
        //JSX Code syntax 
    <section className="main">
        <div className="date">
            <DateTime></DateTime>
        </div>
        <div>
            <h2><strong>Joshua</strong></h2>
            <hr></hr>
            <p>Loading this section</p>
        </div>
        <div>
            <hr></hr>
            <ExpenseItem></ExpenseItem>

        </div>
    </section>

    );

}

export default App;
